$templateCache.put("core/sysadmin.tpl.html","<h3>SysAdmin</h3>\n<p>I\'ve always been afraid of consider my self an system administrator. Since i remember i\'m familiar with the Unix shell, i know how major distributions works and differ from each other as well i invested a lot of time in security.</p>\n<p>Even so i didn\'t consider my self as a sysadmin. On the last 2 years i\'ve deal with small projects where customers can\'t affoard to hire this type of services. So i started been responsible for maintaining servers, i had to implement solutions like customer relationship and advanced file sharing. After a few time installing dozens of servers, doing security patches and finding vulnerabilities i\'m now confident enough to consider an real <b>SysAdmin</b>.</p>\n<p>I\'m proud enough to say that while servers are on my responsability, none got hacked by the traditional means. I was only affected by DDOS attacks and Spam related to the software it self, and not server security faults.</p>\n<p>I monitor all the instances with open source technologies and for a few years i was able to provide free services like webhosting and file sharing thanks to the confort i felt administrating those servers without needing third party help.</p>");
$templateCache.put("core/article/article-card.tpl.html","<div class=\"pi-card\" pi-class-hover=\"pi-card--hover\">\n    <span class=\"pi-card__date\" am-time-ago=\"article.datePublished\"></span> <span class=\"pi-card__tag\" ng-repeat=\"keyword in article.keywords\" ng-bind=\"keyword\"></span>\n    <div class=\"pi-card__thumb\">\n        <a ng-style=\"{\'background-image\': \'url({{article.image}})\'}\" class=\"pi-card__thumb-anchor\" ui-sref=\"article-view({name: article.urlName, id: article.id})\"></a>\n        <div class=\"pi-card__content\">\n            <p ng-bind=\"article.headline\"></p>\n        </div>\n    </div>\n    <ul class=\"pi-card__social\" ng-if=\"showSocial\">\n        <li>\n            <a href=\"javascript:void(0)\"><i class=\"icon ion-social-facebook\"></i></a>\n            <span class=\"pi-card__social-count\">0</span>\n        </li>\n        <li>\n            <a href=\"javascript:void(0)\"><i class=\"icon ion-social-twitter\"></i></a>\n            <span class=\"pi-card__social-count\">0</span>\n        </li>\n        <li>\n            <a href=\"javascript:void(0)\"><i class=\"icon ion-social-googleplus\"></i></a>\n            <span class=\"pi-card__social-count\">0</span>\n        </li>\n    </ul>\n    <div class=\"pi-card__info\">\n        <a class=\"pi-card__title\" ui-sref=\"article-view({name: article.urlName, id: article.id})\" ng-bind=\"article.name\"></a>\n    </div>\n</div>\n");
$templateCache.put("core/article/article-list.tpl.html","<div class=\"home-intro\" ng-init=\"show=true\">\n	<div ng-show=\"show\">\n		<h2 class=\"home-intro__head\">Want to hire me? I\'m willing to realocate <a alt=\"Fechar\" class=\"head__close-icon\" ng-click=\"show=false\"><i class=\"icon ion-close-round\"></i></a></h2>\n		<p>Hi, my name is Guilherme and i\'ve 24 years old. I\'ve been working for programming companies for almost 5 years and started with TCL with 13/14. I didn\'t ended up my education because i started working for a company at 18 developing custom PHP applications, then going to C# consultant companies.</p>\n		<p>I\'m currently looking for a new home to <u>work for</u>.</p>\n		<ul>\n			<li><b>Programming Languages:</b> C#, PHP and Python. Also minor knowledge of TCL, C++ and Ruby</li>\n			<li><b>Frameworks:</b> ServiceStack, .NET Web API, PHP Frameworks (Laravel, Slim, etc)</li>\n			<li><b>Clientside:</b> LESS and SASS. Convert PSD templates to HTML W3C validated </li>\n			<li><b>Clientside Frameworks:</b> AngularJS 1.X and 2, Backbone, ExtJS</li>\n			<li><b>SysAdmin:</b> I manage a few servers for diferent porpuses as Email Hosting, P2P networks, Web Hosting, VOIP, Video Streaming, Gaming Servers, IRC based services, servers monitoring technologies like Icinga. </li>\n		</ul>\n		<p>I\'m a Linux guy (Gentoo and Debian), i dont use a mobile phone and my code style is improving each day. I code with TDD, implement the (most) appropriate design patterns. Both in C# and PHP i\'ve worked with several frameworks like ServiceStack, CodeIgniter, Laravel, Slim, etc to provide REST APIs as well SOAP.<br>\n		I love <b>Service Oriented Architecture</b>. For the projects i\'ve worked on, micro services are usually a great way to go and organize large applications.</p>\n		<p>Read more: <a ui-sref=\"client-side\">Client Side</a>, <a ui-sref=\"php\">PHP/HHVM</a>, <a ui-sref=\"csharp\">C#</a> and <a ui-sref=\"sysadmin\">SysAdmin</a>.<br>I\'m also writting an PHP/Hacklang Framework - <a href=\"https://github.com/guilhermegeek/pi-framework/tree/dev\">Pi Services</a>.</p>\n		<p><a href=\"mailto:email@guilhermecardoso.pt\">email@guilhermecardoso.pt</a> | <a href=\"http://stackoverflow.com/users/365383/guilherme-cardoso\">Stackoverflow</a> | <a href=\"https://github.com/guilhermegeek/\">Github</a></p>\n	</div>\n	<div ng-show=\"!show\"><a ng-click=\"show=true\">Want to hire me?</a></div>\n</div>\n<div masonry infinite-scroll=\"ctrl.query()\" infinite-scroll-disabled=\"ctrl.queryModel.busy\" infinite-scroll-immediate-check=\"true\" class=\"masonry-brick__wrapper\">\n	<div class=\"ng-cloak\" ng-show=\"ctrl.results.length === 0\">No results to display.</div>\n	<div class=\"masonry-brick\" ng-repeat=\"news in ctrl.results\">\n  	<div codigo-article-card show-social=\"true\" article=\"news\"></div>\n	</div>\n</div>\n");
